import React from 'react';
import './Register.css';

class Register extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isTeamNameAvailable: false
    };
    this.checkTeamAvailable = this.checkTeamAvailable.bind(this);
}
checkTeamAvailable(){}

render() {
  return (
    <div className="header">
        <div className="headerBackground">
        <div className="heading">Break the ENGIMA</div>
        <div className="quote">“Those who can imagine anything, can create the impossible.”
            ― Alan Turing</div>
        </div>
        <div className="registerForm">
            <div className="teamName">Enter Team Name</div>
            <div className="teamNameDiv"><input type="text" className="teamNameInput"/></div>
            <div className="submitDiv"><div className="submitButton">Check Validity</div></div>
        </div>
        {this.state.isTeamNameAvailable === true?<div>Team</div>:<div>No team</div>}
    </div>
  );
}
}
export default Register;
